// https://github.com/gitfrosh/lotr-api
// https://the-one-api.dev/
// https://the-one-api.dev/v2/book

import React, {useEffect, useState} from 'react';

const fetchBooks = async () => {
    const response = await fetch(`https://the-one-api.dev/v2/book`);
    const result = await response.json();
    return result;
};

const List = () => {
    const [books, setBooks] = useState([]);

    useEffect(() => {
        fetchBooks().then(data => setBooks(data.docs));
    }, []);

    return (
        <section className="books">
            {books.map(book => {
                return (
                    <div key={book._id} id={book._id}>
                        <h3>{book.name}</h3>
                    </div>
                )
            })}
            {console.log(books, book._id)}
        </section>
    );
}

const Item = ({book}) => {
    return (
        <div id={book.id}>
            <h3>{book.name}</h3>
        </div>
    );
}


const Books = () => {
    return (
        <List/>
    );
}

export default Books;
